import React from "react";
import Grid from "./Grid";
export default function Cards() {
  return (
    <div className="cards">
      <Grid
        img="../images/ankur-warikoo.png"
        title="Work Ethics with Ankur Warikoo"
      />
      <Grid img="../images/japan-forest.png" title="Sightseeing in Japan" />
      <Grid
        img="../images/scuba-diving.png"
        title="Diving in The Great Barrier Reef"
      />
      <Grid img="../images/" />
    </div>
  );
}
